window.bookSummaryJSON = "<p>You are one step away from understanding all you need to obtain your ham radio license if can make the decision to purchase this book.&nbsp;</p> <p>This ham guide gives you everything you need out of ham as a hobby - from basic hamming techniques to tips needed to get the best out of ham radio. The book takes you through all the tips you will need to pass your license exams and finally obtain your license.&nbsp;</p> <p>The “ham for emergency” aspect explains how hams can be used in a period of emergency. The various ways you can find and join a ham club, what benefit you can render to the club as a member, and how you can get the best out of ham groups have been clearly explained in this guide. All the basic radio operating frequencies are clearly explained, including tips on how you can maximize each of them.&nbsp;</p> <p>The guide also provides you with tips on how to maintain and improve your radio station. All the details about the FCC exams and how you can register have been provided with tips to study for your exams and pass well.&nbsp;</p> <p><b>You don’t get to know what is inside until you scroll up and hit the \"buy now\" button to get a copy.</b>&nbsp;</p>"; 
